.section .text

.globl 	drawMenu
drawMenu:
	push {r4, lr}

	ldr 	r0, =titleImage
	mov 	r1, #122 
	mov 	r2, #190
	mov 	r3, #780
	mov 	r4, #388
	push 	{r0, r1, r2, r3, r4}
	bl 		DrawImage	
	
	mov 	r4, #0 // 0 denotes start, 1 denotes quit
	ldr 	r0, =menuStart
	bl 		menuSelection

	//awaitSelection:

		bl 		Read_SNES

		// check if A was pressed
		// tst 	r0, #0x100 // #0b100000000	
		// beq 	optionSelected

		//check if up was pressed
		tst		r0, #0x10 // #0b10000
		cmp 	r4, #0
		ldreq 	r0, =menuQuit
		ldrne 	r0, =menuStart
		bl 		menuSelection
		//b 		awaitSelection

		//check if down was pressed
		tst 	r0, #0x20 // #0b100000
		cmp 	r4, #0
		ldreq 	r0, =menuQuit
		ldrne 	r0, =menuStart
		bl 		menuSelection		
		//b 		awaitSelection

	optionSelected:
	pop 	{r4, pc}

menuSelection:
	push {lr}

	ldr r1, =362
	ldr r2, =400
	mov r3, #255
	mov r4, #82
	push {r0, r1, r2, r3, r4}
	bl DrawImage

	pop {pc}


